return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'es','pot-creation-date'=>'2026-02-04 13:08-0600','po-revision-date'=>'2026-02-04 13:08-0600','translation-revision-date'=>'2026-02-04 13:08-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s está actualmente %2$sen pausa%3$s y no muestra calendarios en las páginas frontales. Puede reanudar la visualización de calendarios en la pestaña %4$sUtilidades%5$s %6$saquí%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sEstá ejecutando ICS Calendar en una implementación de WordPress Playground.%2$s Dado que ICS Calendar está diseñado para ejecutarse en un servidor web, es posible que algunas funciones no estén disponibles o no funcionen correctamente.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sTu sitio web utiliza actualmente una configuración de zona horaria basada en la diferencia horaria UTC.%2$s Esto puede provocar errores en la visualización de la hora en el %3$scomplemento en lugares que aplican el horario de verano. Por favor, %4$scambia la configuración de tu zona horaria%5$s a la ciudad más cercana a tu ubicación, en la misma zona horaria, para que la hora se muestre correctamente. Consulta nuestra %6$sdocumentación%7$s para obtener más información sobre este tema.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'¡Importante! Su configuración %1$s parece estar excediendo los límites de frecuencia del proveedor del calendario de origen.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Si sus calendarios no se cargan correctamente, revise la configuración y el uso de %1$s:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'No utilices %1$s en tus códigos cortos. Esta función está pensada únicamente para la resolución de problemas y no debe dejarse activada de forma permanente.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Aumente el ajuste %1$s %2$sCaducidad transitoria (caché)%3$s a %4$s43200%5$s (12 horas) o más, para reducir la frecuencia de las solicitudes al proveedor. (Véase la nota más abajo).','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Evita incluir un gran número de feeds (10 o más) del mismo proveedor en un solo código corto %1$s.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Pause temporalmente el calendario ICS en sus páginas front-end utilizando la utilidad %1$sPausar calendarios%2$s. (Se recomienda entre 24 y 48 horas).','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s incluye almacenamiento en caché integrado, específicamente para mejorar el rendimiento y evitar exceder los límites de velocidad del proveedor. Eludir este almacenamiento en caché con una configuración muy baja de %2$srecarga%3$s puede provocar un bloqueo temporal de la dirección IP de su servidor web, o posiblemente de toda su red de alojamiento, por parte del proveedor del calendario.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Después de realizar los cambios recomendados, espere hasta 24 horas para que su proveedor de calendario elimine cualquier bloqueo temporal en su dirección IP. Si el problema persiste, utilice nuestro %1$sformulario de solicitud de asistencia%2$s para ponerse en contacto con nosotros y asegúrese de incluir su %3$sinforme del sistema%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Nota: Establezca el valor %1$sCaducidad transitoria (caché)%2$s lo más alto posible, teniendo en cuenta la frecuencia con la que se actualiza normalmente la información de eventos en su calendario. %3$s Recuerde que puede utilizar la utilidad %4$sBorrar datos del calendario almacenados en caché%5$s para borrar manualmente la caché en cualquier momento, si es necesario.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sNota: %2$s %3$s La versión 10.6 cambia las opciones predeterminadas para varios ajustes de códigos cortos. Para mantener la coherencia, estos nuevos valores predeterminados %4$sno%5$s se activan al actualizar desde una versión anterior. Si desea obtener más información sobre los cambios, lea nuestra %6$sentrada del blog%7$s, o para cambiar a los nuevos valores predeterminados, active la %8$sopción en la página %9$sconfiguración%10$s.','Use new parameter defaults (v.10.6)'=>'Usar nuevos valores predeterminados para los parámetros (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sNota: %2$s %3$s La versión 11.0 optimiza la forma en que se recuperan las URL de los feeds ICS. Este cambio utiliza una función estándar integrada en WordPress, por lo que debería ser totalmente compatible con todas las instalaciones existentes. Si encuentra algún problema nuevo después de actualizar a la versión 11 o posterior, visite los %4$sforos de soporte de WordPress%5$s para obtener ayuda.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sNota: %2$s %3$s La versión 11.5.14.2 introduce un nuevo método más seguro para gestionar los parámetros del calendario al cargarlo mediante AJAX. Borra cualquier complemento de almacenamiento en caché que estés utilizando para asegurarte de que tus calendarios se cargan correctamente con el nuevo método.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$s¡Bienvenido a la %2$s versión 12!%3$s La versión 12.0 introduce herramientas adicionales para la resolución de problemas, además de una serie de mejoras en el rendimiento y perfeccionamientos en la interfaz. Consulte el %4$sregistro de cambios%5$s para obtener más detalles sobre esta actualización.','Getting Started'=>'Empezando','Settings'=>'Ajustes','Appearance'=>'Apariencia','Utilities'=>'Utilidades','System Report'=>'Informe del Sistema','Support'=>'Soporte','Upgrade to %1$s!'=>'¡Actualiza a %1$s!','Show/hide all'=>'Mostrar/ocultar todo','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'No se pudo recuperar el archivo ICS o estaba vacío. Comprueba que la URL sea correcta y revisa la configuración de php.ini para verificar que cURL o allow_url_fopen estén disponibles. Si utilizas espacios para delimitar varias URL, también puedes intentar utilizar el carácter de barra vertical en su lugar. URL afectada:','Hide past events'=>'Ocultar eventos pasados','Show past events'=>'Mostrar eventos pasados','Contact:'=>'Contacto:','Resources:'=>'Recursos:','Click for more...'=>'Haga clic para más información...','Save to your calendar'=>'Guarda en tu calendario','Cancelled'=>'Cancelado','The legacy parser option is deprecated and will be removed in a future update.'=>'La opción del analizador heredado está obsoleta y se eliminará en una futura actualización.','Print'=>'Imprimir','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'El atributo «currentweek» del código corto ha quedado obsoleto. Utilice en su lugar view="week" en su código corto.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'El atributo «legendinline» del código corto ha quedado obsoleto. Utilice legendstyle="inline" en su código corto en su lugar.','%1$s has %2$sresumed%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s ha %2$sreanudado%3$s el servicio de calendarios en las páginas frontales. Si su sitio utiliza un complemento de almacenamiento en caché, es posible que tenga que borrar la caché.','%1$s has %2$spaused%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s ha %2$ssuspendido%3$s la publicación de calendarios en las páginas frontales. Si su sitio utiliza un complemento de almacenamiento en caché, es posible que deba borrar la caché.','Cleared %1$s %2$s transient(s).'=>'Se han eliminado %1$s %2$s transitorios.','No %1$s transients were found.'=>'No se encontraron transitorios %1$s.','All saved ICS feed URLs have been cleared.'=>'Se han borrado todas las URL de fuentes ICS guardadas.','All %1$s settings have been reset to defaults, and saved ICS feed URLs have been cleared.'=>'Todos los ajustes %1$s se han restablecido a los valores predeterminados y se han borrado las URL de fuentes ICS guardadas.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Tu URL de feed parece contener credenciales de autenticación básica HTTP. Intenta desactivar la opción %1$s en la pestaña %2$s situada arriba.','Use legacy feed request method'=>'Utilizar el método de solicitud de feed heredado','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sEsta URL apunta a un archivo de tu biblioteca multimedia.%2$s Aunque deberías poder utilizar esta URL en un %3$scódigo corto, será una instantánea estática del calendario en el momento en que se creó el archivo y no reflejará ninguna actualización futura del calendario de origen. Consulta nuestra %4$sGuía del usuario%5$s para obtener instrucciones sobre cómo obtener la URL dinámica correcta.','Error: Could not resolve IP address for %1$s.'=>'Error: No se pudo resolver la dirección IP para %1$s.','Resolved IP address for %1$s:'=>'Dirección IP resuelta para %1$s:','%1$sAppearance updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sApariencia actualizada.%2$s Es posible que tengas que actualizar la página para ver algunos cambios.','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'El texto introducido en el campo «Código corto predeterminado» no es un código corto válido y no se ha guardado.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sConfiguración actualizada.%2$s Es posible que tengas que actualizar la página para ver algunos cambios.','calendar event'=>'evento del calendario','Event download failed.'=>'Error al descargar el evento.','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'El método de solicitud de feeds heredado está obsoleto y se eliminará en una actualización próxima. Prueba tus feeds con el método de solicitud de feeds heredado desactivado.','Future updates of %1$s will require WordPress 5.3 or newer. Please update your site to a newer version of WordPress as soon as possible.'=>'Las futuras actualizaciones de %1$s requerirán WordPress 5.3 o una versión más reciente. Actualiza tu sitio a una versión más reciente de WordPress lo antes posible.','An error occurred with %1$s while attempting to copy language translation files. The required PHP filesystem function %2$s is unavailable. This is required to address a conflict with certain translation customization plugins such as %3$s. As a result, %1$s translations may not load properly while the conflicting translation plugin is active.'=>'Se ha producido un error con %1$s al intentar copiar los archivos de traducción de idiomas. La función del sistema de archivos PHP requerida %2$s no está disponible. Esto es necesario para resolver un conflicto con determinados complementos de personalización de traducciones, como %3$s. Como resultado, es posible que las traducciones %1$s no se carguen correctamente mientras el complemento de traducción conflictivo esté activo.','Map'=>'Mapa','Recurring event'=>'Evento recurrente','Recurs every %1$s years'=>'Se repite cada %1$s años','Recurs yearly'=>'Se repite anualmente','Recurs every %1$s months'=>'Se repite cada %1$s meses','Recurs monthly'=>'Se repite mensualmente','Recurs every %1$s weeks'=>'Se repite cada %1$s semanas','Recurs weekly'=>'Se repite semanalmente','Recurs every %1$s days'=>'Se repite cada %1$s días','Recurs daily'=>'Se repite diariamente','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'La propiedad «url» de tu código corto %1$s parece contener etiquetas HTML; lo más probable es que tu URL se haya convertido en un enlace en el que se puede hacer clic. Como resultado, es posible que tu calendario no se muestre correctamente. Elimina el enlace en el que se puede hacer clic del código corto.','The r34ics_url_get_contents() function is no longer supported.'=>'La función r34ics_url_get_contents() ya no es compatible.','Add %1$s'=>'Añadir %1$s','Close'=>'Cerrar','ICS Feed URL:'=>'URL del feed ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Asegúrate de que estás utilizando una URL %1$sde suscripción%2$s, no una URL %3$sde vista web%4$s.%5$s (Al introducir la URL directamente en tu navegador web, se debería descargar un %6$sarchivo).','Calendar Title:'=>'Título del calendario:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Déjelo vacío para utilizar el título predeterminado del calendario. Introduzca %1$s para omitir el título por completo.','Calendar Description:'=>'Descripción del calendario:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Déjelo vacío para utilizar la descripción predeterminada del calendario. Introduzca %1$s para omitir la descripción por completo.','View:'=>'Ver:','month'=>'mes','list'=>'lista','week'=>'semana','Count:'=>'Cantidad:','Format:'=>'Formato:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Deje %1$s en blanco para incluir todos los próximos eventos. %2$s debe ser una cadena de formato de fecha PHP estándar %3$s%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Mostrar descripciones de eventos %1$s (cambiar a un número en el código corto insertado para establecer el límite de palabras) %2$s','Show event locations %1$s(if available)%2$s'=>'Mostrar ubicaciones de eventos %1$s (si están disponibles) %2$s','Show event organizers %1$s(if available)%2$s'=>'Mostrar organizadores del evento %1$s (si está disponible) %2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sNota:%2$s Hay disponibles %3$sopciones de visualización%4$s adicionales mediante la edición manual del código abreviado después de su inserción.','Insert %1$s'=>'Insertar %1$s','Do even more with %1$s version 6!'=>'¡Haz aún más con la versión 6 de %1$s!','Calendar Builder + Block Editor'=>'Creador de calendarios + Editor de bloques','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Configura todos los ajustes del calendario con una interfaz visual sencilla y utiliza el nuevo bloque %1$s para seleccionar tus calendarios guardados en un menú desplegable del editor de bloques, ¡sin necesidad de códigos cortos! %2$sMás información...%3$s','Additional Views and Enhanced Features'=>'Vistas adicionales y funciones mejoradas','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s ofrece muchas formas nuevas de mostrar tu calendario, incluidas integraciones con las populares bibliotecas de código abierto %2$s y %3$s. Vistas mensuales y anuales con una barra lateral para el día seleccionado. «Próximamente» funciona muy bien para las programaciones de emisoras de radio o canales de televisión. Los widgets y la disponibilidad anual son perfectos para las reservas de vacaciones. Además, se han añadido funciones adicionales a las vistas principales Mensual, Básica, Lista y Semanal. %4$sVer calendarios de muestra...%5$s','Customization'=>'Personalización','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Herramientas fáciles de usar para personalizar completamente los colores, la tipografía y mucho más de tu calendario. Selecciona una de nuestras paletas de colores preestablecidas o crea la tuya propia, con opciones para personalizar individualmente el color de cada elemento del diseño del calendario. Elige entre las fuentes de tu tema, las fuentes del sistema o más de 20 fuentes de código abierto incluidas. %1$sMás información...%2$s','ICS Events'=>'Eventos ICS','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Convierte %1$s en un completo sistema de gestión de calendarios. Crea y edita nuevos eventos directamente en WordPress, e incluso intégralos a la perfección con tus fuentes ICS externas existentes. %2$sMás información...%3$s','Localized Admin Interface'=>'Interfaz de administración localizada','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Todas las páginas de administración %1$s están traducidas a docenas de idiomas, incluyendo inglés, checo, danés, alemán, griego, español, estonio, finés, francés, húngaro, italiano, japonés, coreano, lituano, letón, noruego, neerlandés, polaco, portugués, rumano, ruso, eslovaco, serbio, sueco, turco, ucraniano y chino.','Visit %1$s to learn more.'=>'Visite %1$s para obtener más información.','Calendar Builder screenshot'=>'Captura de pantalla del generador de calendarios','Appearance screenshot'=>'Captura de pantalla de apariencia','Available now!'=>'¡Ya disponible!','Get %1$s!'=>'¡Consigue %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'Hay disponible una amplia paleta de colores y opciones tipográficas con %1$s. %2$sMás información%3$s','Color Palette'=>'Paleta de Color','Match calendar color palette to current Block Theme colors'=>'Ajustar la paleta de colores del calendario a los colores actuales del tema del bloque.','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Reemplaza la paleta de colores neutros predeterminada %1$s con los colores más similares de la paleta de colores actual del Editor de sitios o del archivo %2$s de tu tema. Las selecciones de color son algorítmicas y es posible que algunas combinaciones no superen las pruebas de contraste de accesibilidad. Esta configuración no tiene ningún efecto si utilizas un tema «clásico» que no incluye un archivo %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sActualmente se trata de una función beta.%2$s Es posible que sea necesario realizar algunos ajustes en la apariencia de tu calendario o en el CSS para obtener una visualización óptima, especialmente si has codificado por colores tus fuentes. La funcionalidad está sujeta a cambios.','Dark mode'=>'Modo oscuro','Inverts color palette (light colors on a dark background).'=>'Inverte la paleta de colores (colores claros sobre fondo oscuro).','Save Changes'=>'Guardar cambios','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Gracias por instalar %1$s. Antes de crear tu primer código corto de calendario, visita la página %2$sConfiguración general%3$s y comprueba que el idioma, la zona horaria y el formato de fecha y hora de tu sitio web sean correctos. Consulta nuestra %4$sGuía del usuario%5$s para obtener más información.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Empiece con %1$s en cuatro sencillos pasos... ¡y ya ha completado el primer paso! Consulte nuestra %2$sGuía de inicio rápido%3$s para ver el resto.','Quick Start Guide'=>'Guía de inicio rápido','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'En nuestro sitio web hay disponible una completa %1$sGuía del usuario%2$s. A continuación se incluyen algunos enlaces rápidos a recursos clave de la documentación.','General:'=>'General:','General WordPress Settings'=>'Configuración general de WordPress','%1$s Settings'=>'%1$s Ajustes','Working with Shortcodes:'=>'Trabajar con códigos cortos:','Shortcode Overview'=>'Descripción general del código corto','Shortcode Builder'=>'Generador de código corto','Shortcode Parameters Reference'=>'Referencia de parámetros de códigos cortos','Advanced Topics:'=>'Temas avanzados:','FAQs and Tips'=>'Preguntas frecuentes y consejos','CSS Guide'=>'Guía CSS','Developer Resources'=>'Recursos para desarrolladores','GDPR'=>'GDPR','Loading'=>'Cargando','Always use AJAX to render calendars'=>'Utiliza siempre AJAX para renderizar calendarios.','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'La carga AJAX ahora es automática. Si es necesario, puede anular AJAX añadiendo %1$s a su código corto.','Increase memory limit when rendering calendars'=>'Aumentar el límite de memoria al renderizar calendarios','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Si su calendario no se carga y aparece un error fatal de «memoria insuficiente», intente aumentar el límite de memoria. Se recomienda un mínimo de 512 MB. %1$s Notas: 1) Es posible que algunos proveedores de alojamiento no permitan que las aplicaciones anulen la configuración predeterminada del servidor. 2) No es posible establecer esta opción por debajo del límite de memoria predeterminado actual de su servidor.','deprecated'=>'obsoleto','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Es posible que algunos servidores no admitan el método de solicitud de feeds predeterminado. Si tus feeds no se cargan, activa esta opción para utilizar el método de solicitud heredado. Esta función está obsoleta y se eliminará en una futura actualización.','Default shortcode'=>'Código corto predeterminado','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Si tu sitio web va a incluir un gran número de códigos cortos de calendario con una configuración similar, puedes introducir aquí un código corto «base» predeterminado con los parámetros que deben ser iguales para todos los calendarios. Los códigos cortos individuales del sitio web solo podrán incluir los parámetros que sean exclusivos de ese calendario, de la siguiente manera: %1$s Cualquier parámetro incluido en el código corto individual prevalecerá sobre lo que se haya establecido aquí.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Permitir el acceso a estos nombres de host que se resuelven en direcciones IP reservadas.','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Si su servidor de calendario está alojado en el mismo servidor físico que su sitio web, forma parte de la misma red local o utiliza una %1$sdirección IP reservada%2$s, introduzca aquí su nombre de host para permitir el acceso. Si tiene varios servidores de calendario, introduzca un nombre de host por línea. Consulte %3$sla %4$s documentación%5$s para obtener más información.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Introduzca un nombre de host por línea. Los nombres de host son el nombre de dominio base, no una URL completa. %1$s Por ejemplo, introduciría %2$s, no %3$s.','Allow access to these ports'=>'Permitir el acceso a estos puertos','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress permite automáticamente el acceso a los puertos 80, 443 y 8080. Si necesita acceder a calendarios de origen que utilizan puertos no estándar, introduzca aquí los números de puerto, separados por comas.','Caching'=>'Caching','Transient (cache) expiration'=>'Caducidad transitoria (caché)','seconds'=>'segundos','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Establece cuánto tiempo deben almacenarse en caché los datos del feed del calendario en el servidor (transitorios de WordPress) antes de volver a cargarse. El valor predeterminado es 3600 (1 hora). El valor mínimo permitido es 120 (2 minutos).','Admin'=>'Administrador','Minimum access role'=>'Función de acceso mínimo','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Identifica el rol de usuario mínimo al que se le permite acceder a %1$s páginas de administración. Ciertas áreas, como Configuración, están restringidas únicamente a %2$s usuarios (%3$s usuarios en configuraciones multisitio).','Register Customizer'=>'Personalizador de registro','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress ya no incluye un enlace al Personalizador en el menú Apariencia cuando hay un tema de bloques activo. Marca esta casilla si deseas utilizar el Personalizador, por ejemplo, para introducir CSS adicional. Nota: Es posible que algunos temas o plugins ya tengan registrado el Personalizador, en cuyo caso esta configuración no tendrá ningún efecto. (La casilla solo habilita el Personalizador cuando está marcada; no lo deshabilita cuando está desmarcada).','Remove "Add ICS Calendar" button in Classic Editor'=>'Eliminar el botón «Añadir calendario ICS» en el editor clásico','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'De forma predeterminada, ICS Calendar añade un botón «Añadir calendario ICS» a la barra de herramientas situada encima del editor WYSIWYG cuando se utiliza el editor clásico. Marque esta casilla para eliminar el botón. No tiene ningún efecto en los sitios que utilizan el editor de bloques (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s La versión 10.6 introdujo nuevos valores por defecto para varios parámetros del shortcode. Las nuevas instalaciones utilizan automáticamente los nuevos valores por defecto, pero las instalaciones actualizadas seguirán utilizando los antiguos valores por defecto, a menos que se marque esta casilla. Lea más sobre estos cambios en %2$snuestro blog%3$s.','User Guide'=>'Manual de usuario','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Nuestra guía de usuario completa está disponible con traducción completa a docenas de idiomas en nuestro sitio web:','For assistance, please use our %1$ssupport request form%2$s.'=>'Si necesita ayuda, utilice nuestro %1$sformulario de solicitud de asistencia%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Cuando se ponga en contacto con el servicio de asistencia, incluya el %1$sinforme del sistema%2$s de esta página.','Spread the word!'=>'¡Difunde la palabra!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Si le resulta útil %1$s, puede ayudarnos a seguir creciendo y desarrollándonos con un comentario de %2$scinco estrellas%3$s. ¡Muchas gracias!','Calendar Status: %1$sPaused%2$s'=>'Estado del calendario: %1$sEn pausa%2$s','Calendar Status: %1$sActive%2$s'=>'Estado del calendario: %1$sActivo%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Utilice el botón de pausa si necesita desactivar temporalmente %1$s en las páginas frontales.','Resume Calendars'=>'Calendarios de currículums','Pause Calendars'=>'Calendarios de pausa','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'No se modificará ningún contenido, pero sus calendarios quedarán ocultos y no se cargarán archivos %1$s (JavaScript, CSS) en las páginas front-end. Si utiliza el almacenamiento en caché a través de un complemento o de su proveedor de alojamiento, es posible que tenga que borrar la caché después de cambiar esta configuración.','%1$s Data Cache'=>'%1$s Caché de datos','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Esto borrará inmediatamente todos los datos del calendario almacenados en la caché (purga transitoria), lo que obligará a WordPress a volver a cargar todos los calendarios la próxima vez que se visualicen. A continuación, el almacenamiento en caché se reanudará como antes.','Clear Cached Calendar Data'=>'Borrar datos almacenados en caché del calendario','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Si utiliza un complemento de almacenamiento en caché de terceros, es posible que tenga que borrar la caché de todo el sitio después de ejecutar esta utilidad.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'¿Está seguro? Esto restablecerá todos los ajustes %1$s a sus valores predeterminados. Se conservarán las configuraciones y los códigos cortos guardados del calendario, pero restablecer los valores predeterminados puede cambiar el aspecto de los calendarios. Si utiliza un complemento de almacenamiento en caché de terceros, es posible que tenga que borrar la caché de todo el sitio después de ejecutar esta utilidad.','Only clear transients (default)'=>'Solo transitorios claros (predeterminado)','Also clear all saved ICS feed URLs'=>'Borrar también todas las URL de fuentes ICS guardadas.','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Restablecer %1$stodos%2$s %3$s los ajustes (incluidos los transitorios y las URL de alimentación)','Last cleared:'=>'Última limpieza:','never'=>'nunca','ICS Feed URL Tester'=>'Probador de URL de fuente ICS','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Si te preocupa que el complemento no esté recuperando correctamente tu feed, puedes probar la URL aquí.','Enter feed URL...'=>'Introduzca la URL del feed...','Test URL'=>'URL de prueba','Results:'=>'Resultados:','%1$s received.'=>'%1$s recibido.','This appears to be a valid ICS feed URL.'=>'Esta parece ser una URL válida para la fuente ICS.','unknown'=>'desconocido','This does not appear to be a valid ICS feed URL.'=>'Esta URL no parece ser una URL válida para la fuente ICS.','Could not retrieve data from the requested URL.'=>'No se pudieron recuperar los datos de la URL solicitada.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Se ha producido un error desconocido al intentar recuperar la URL solicitada.','Please copy the following text and include it in your message when emailing support.'=>'Copie el siguiente texto e inclúyalo en su mensaje cuando envíe un correo electrónico al servicio de asistencia.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Incluya también el código abreviado %1$s tal y como lo ha introducido en la página afectada.','No events found.'=>'No hay eventos encontrados.','Previous Page'=>'Página anterior','Next Page'=>'Siguiente página','All Day'=>'Todo el día','Previous Month'=>'Mes anterior','Next Month'=>'Próximo Mes','Today'=>'Hoy','Month selection'=>'Selección de mes','No events.'=>'No hay eventos.','No additional events this month.'=>'No hay eventos adicionales este mes.','Week selection'=>'Selección semanal','Last week'=>'La semana pasada','This week'=>'Esta semana','Next week'=>'Próxima semana','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Convierte tu calendario de Google, Microsoft Office 365 o Apple iCloud en una experiencia WordPress perfectamente integrada, con actualización automática y sin mantenimiento.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
